import { useEffect, useState } from "react";

export default function EventsPage() {
  const [events, setEvents] = useState([]);
  const [isLoading, setIsLoading] = useState(false);
  useEffect(()=>{
    fetchEvents();
  },[])

  
  return (
    <>
      {!isLoading ? <p>Dupa</p> : undefined}
      <h1>Events Page</h1>
    </>
  );
}
